export default function Error() {
    return (
        <main class="notfound" id="main">
            <div class="container">
                <section>
                    <h2 class="main-title">404</h2>
                    <p>Không tìm thấy trang</p>
                    <a href="#" class="btn main round">Trang chủ</a>
                </section>
            </div>
        </main>
    )
}
